import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <footer>
      Feito com
      <span role="img" aria-label="coração">
        ❤️
      </span>
      Por Vinny Braga <br />
      Direitos de imagem para a NetFlix
      <br />
      Api utilizada do site:
      <br />
      Themoviedb.org
    </footer>
  );
};
export default Footer;
